import React from 'react';
import Tour from './Tour';

const Tours = ({ tours }) => {

  const tourList = tours.map(tour => {
   const { id, name, info, image, price } = tour;
    return <Tour
      key={id}
      id={id}
      name={name}
      info={info}
      image={image}
      price={price}
      />;
  });

  return (
    <section>
      <div className='title'>
        <h2>Our Tours</h2>
        <div className='underline'></div>
      </div>
      <div>
        { tourList }
      </div>
    </section>
  );
};

export default Tours;
